import '../assets/css/ThreeItem.css';
import ItemPro3 from './ItemPro3';
import PayCenter from '../components/PayCenter';
import ItemDivide from '../components/ItemDivide';
class ThreeItem extends React.Component {
  // componentDidMount() {
  //   document.title = '开发中';
  //  }

  render() {
    const { itemData } = this.props;
    const dataProps_1={
      imgUrl:itemData&&itemData['goods_list']?itemData['goods_list'][0]['image']:null,
      oldPrice:itemData&&itemData['goods_list']?itemData['goods_list'][0]['price']:null,
      title:itemData&&itemData['goods_list']?itemData['goods_list'][0]['title']:null,
    }
    const dataProps_2={
      imgUrl:itemData&&itemData['goods_list']?itemData['goods_list'][1]['image']:null,
      oldPrice:itemData&&itemData['goods_list']?itemData['goods_list'][1]['price']:null,
      title:itemData&&itemData['goods_list']?itemData['goods_list'][1]['title']:null,
    }
    const dataProps_3={
      imgUrl:itemData&&itemData['goods_list']?itemData['goods_list'][2]['image']:null,
      oldPrice:itemData&&itemData['goods_list']?itemData['goods_list'][2]['price']:null,
      title:itemData&&itemData['goods_list']?itemData['goods_list'][2]['title']:null,
    }
    return (
      <div className="ThreeItemMain">
        <div className="ThreeItemBox">
          <div className="ThreeItemOne"><ItemPro3 isMain={this.props.fixMain?true:false} {...dataProps_1}/></div>
          <div className="ThreeItemOne"><ItemPro3 {...dataProps_2}/></div>
          <div className="ThreeItemOne"><ItemPro3 {...dataProps_3}/></div>
        </div>
        <PayCenter price="356"/>
        <ItemDivide/>
      </div>
    );
  }
}

export default ThreeItem;
